fragment Address on Address {
  id
  firstName
  lastName
  companyName
  streetAddress1
  streetAddress2
  city
  postalCode
  country {
    code
    country
    __typename
  }
  countryArea
  phone
  isDefaultBillingAddress
  isDefaultShippingAddress
  __typename
}

fragment User on User {
  id
  email
  firstName
  lastName
  isStaff
  defaultShippingAddress {
    ...Address
    __typename
  }
  defaultBillingAddress {
    ...Address
    __typename
  }
  addresses {
    ...Address
    __typename
  }
  __typename
}

fragment AccountError on AccountError {
  code
  field
  message
  __typename
}

mutation SetPassword($token: String!, $email: String!, $password: String!) {
  setPassword(token: $token, email: $email, password: $password) {
    errors: accountErrors {
      ...AccountError
      __typename
    }
    token
    user {
      ...User
      __typename
    }
    accountErrors {
      field
      message
      code
      __typename
    }
    __typename
  }
}
